import React from 'react';

const Step3 = ({ formData, updateFormData, nextStep, prevStep }) => {
  return (
    <div>
      <h2>Step 3</h2>
      <button onClick={prevStep}>Previous</button>
      <button onClick={nextStep}>Next</button>
    </div>
  );
};

export default Step3;
